hlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"648618","type":"CustomJS"},{"attributes":{"source":{"id":"648231"}},"id":"648474","type":"CDSView"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwP2Rld+pRBfA/DWSL1qkQ8D8TfMimYK7vPxptxou7aO8/A017wAC27z+P877/BAfwP7VqwsTHse8/eGsEqMqz7z9jiJ3jwxfwP/9DZBurAvA/UW18J9et7z9HyfG1sZrvP1TiH98qO+8/XMmWR6gp7z/EooC/KNnuP7j/ptMY9u4/+qK+J33a7j+SAvjpJ9zuP43reMmI5u4/KsyaqSf77j8SQM4Z6MHuP0xjzXRquO4/vhTSN7Sz7j+yR5NZZeDuP3KwtrAO6u4/3F0HYxAM7z8ZdLmIgePuP+4h8Djrae8/ib4F2iCB7z8DMj+xsUbvP6vFcTJCx+4/QMBz5Era7j9A9Bh+28fuPwgN10y50O4/H1rrmdN97j/4Ob8j0QTuP8sMCjml0u0/x3kzfxCW7T+9EhZPHKTtP+68EQYzgO0/MVPumYBK7T82GU7MjNTtPzGxy8lqR+0/4GvnyAFM7D/uni24h6rsP3Yf7pV60Ow/RRSnG6fP7D8nroGyyzXsP/77zwPfyes/+PiHpEuM6z/pprZTeKnrP4RTdiSdpOs/SXsxwydu6z+9+g/gIbLrP7mmMhdAues/+PpsMbdj6z+EkUimvVTrP8qQZzaPfOs/fJtLV5Nj6z/zmd3iO2vrP4UXDo2xn+s/WosWMqxR6z8RPLrgt1nrPynS4CIuOus/ZYZn69t36z8agA2IEKfrP4dmQ6Pg3us/Pynx+ZzE6z9v/u8gJ1DrP3eKER0UMes/pepNf4wG6z99wd7jVKvqP1KXy8dnouo/Po6wsdVx6j/tSl+IlG/qP0tNULRDdOo/Q5LPXSFL6j8JJvfcxq3qP+WSqFq9seo/dDXlQXR86j86gAf2v0vqP0tQutgjOeo/2p9PtloG6j+o3MqLPmHpPyK0VY3KW
